import React from 'react';
import {
    Skeleton, Switch, Card, Layout, Icon, Avatar,
} from 'antd';
import LeftBar from "../common/leftbar/index";
import RightTop from "../common/rightTop/index";
import "../../style/article/index.less";
const { Content } = Layout;
const { Meta } = Card;
class ArticleDetals extends React.Component {
    state = {
        collapsed: false,
        loading: true,
    };
    onChange = (checked) => {
        this.setState({ loading: !checked });
    }
    toggle = () => {
        this.setState({
        collapsed: !this.state.collapsed,
        });
    }
    render() {
        const { loading } = this.state;
        return (
        <Layout>
            <LeftBar></LeftBar>
            <Layout>
            <RightTop></RightTop>
            <Content style={{
                margin: '24px 16px', padding: 24, background: '#fff', minHeight: 280,
            }}
            >     
               <div className="article" click='toArticle'>
                    <div className="title"></div>
                        <div className="con"></div>
                        <div className="notes">
                            <div className="left">
                                <div className="author" click='toUserInfo'>
                                    <img src="" alt="userlogo" className="authorlogo"/>
                                    <span className="username"></span>
                                </div>
                            <span className="createTime"></span>
                        </div>
                        <div className="right">
                            <div className="pageviews">
                                <span></span>
                                <span className="views"></span>
                            </div>
                            <div className="comments">
                                <span></span>
                                <span className="commentsLogo"></span>
                            </div>
                            <div className="stars">
                                <span></span>
                                <span className="starts"></span>
                            </div>
                        </div>
                    </div>
            </div>   
            </Content>
            </Layout>
        </Layout>
        );
    }
}

export default ArticleDetals;
